if( 
  totext(lookup("Task", "Deadline")) = "Prior to start", 
  add(
    lookup("New hire", "Start date"), 
    date_interval("-1 days")
  ), 
  if( 
    totext(lookup("Task", "Deadline")) = "First day", 
    lookup("New hire", "Start date"), 
    if( 
      totext(lookup("Task", "Deadline")) = "First week", 
      add(
        lookup("New hire", "Start date"), 
        date_interval("7 days")
      ), 
      if( 
        totext(lookup("Task", "Deadline")) = "First month", 
        add(
          lookup("New hire", "Start date"), 
          date_interval("30 days")
        ),  
        add(
          lookup("New hire", "Start date"), 
          date_interval("180 days")
        ) 
      ) 
    ) 
  ) 
)

join( 
  if( 
    or( 
      int(tonumber(right(totext(lookup("New hire", "Row ID")), 1))) = 1, 
      int(tonumber(right(totext(lookup("New hire", "Row ID")), 1))) = 6 
    ), 
    "S", 
    if( 
      or( 
        int(tonumber(right(totext(lookup("New hire", "Row ID")), 1))) = 2, 
        int(tonumber(right(totext(lookup("New hire", "Row ID")), 1))) = 7 
      ), 
      "R", 
      if( 
        or( 
          int(tonumber(right(totext(lookup("New hire", "Row ID")), 1))) = 3, 
          int(tonumber(right(totext(lookup("New hire", "Row ID")), 1))) = 8 
        ), 
        "Y", 
        if( 
          or( 
            int(tonumber(right(totext(lookup("New hire", "Row ID")), 1))) = 4, 
            int(tonumber(right(totext(lookup("New hire", "Row ID")), 1))) = 9 
          ), 
          "G", 
          "B"
        )
      )
    )
  ), 
  "" 
)

